function [ noise ] = get_default_noise( n_elecs, is_open, is_lungs )
%GET_DEFAULT_NOISE Get the default noise for the specific current pattern
%
%	(C) 2015-2016 Sebastien Martin

if (~is_lungs) && (~is_open) % Standard EIT
    switch n_elecs
        case 8
            noise = default_noise_8_1;
        case 16
            noise = default_noise_16_1;
        case 32
            noise = default_noise_8_4;
    end
end

if (~is_lungs) && (~is_open)
    if n_elecs==16
        noise = default_noise_CS_16_1(CS_step);
    end
end

if (is_lungs) && (n_elecs==16)
    noise = default_noise_lungs_nof;
end

if is_open
    if (n_elecs==8)
        noise = default_noise_unbounded_8_1;
    end
    if (n_elecs==32)
        noise = default_noise_unbounded_8_4;
    end
end

if ~exist('noise','var')
    error('Default noise is missing for this configuration');
end
end

